  \"current-meter-direction-and-other-data-from-fixed-platforms-in-support-of-the-mesa-new-york-bica105\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current meter - direction and other data
  were collected from FIXED PLATFORMS from 01 April 1974 to 25 September 1974. Data
  were collected by the National Ocean Service (NOS) in support of the MESA New York
  Bight (MESA-NYB) project. Data were processed by NODC to the NODC standard F005
  - Current Meter Data (Resultants) format. Full format description is available from
  NODC at www.nodc.noaa.gov/General/NODC-Archive/f005.html.nnThe F005 format is used
  for time series measurements of ocean currents obtained using moored current-measuring
  instruments, principally Aanderaa current meters (manufactured by Aanderaa Instruments
  Inc.). These data represent the Eulerian method of current measurement, i.e., the
  meters are deployed at a fixed mooring point and measure flow past the sensor. Position,
  water depth, and sensor depth are reported for each station. The data record comprises
  values of current direction and speed at specified date and time. Data values may
  be subject to averaging or filtering and are typically reported at 10-15 minute
  time intervals. Other environmental parameters may also be reported. These include:
  water temperature, salinity, conductivity, and transmissivity; wind direction and
  speed; and dominant wave direction, height, and period. A text field is available
  for optional comments.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
